import React from 'react';
import './TableProducts.scss'
const handleLogin = () => {
    window.location.href = "/Movements";
  }
const TableProducts = ({products})=> {
    return(
            <div className="products-table">
            <table>
                <thead>
                <tr>
                    <th>NÃºmero</th>
                    <th>Nombre</th>
                    <th>Marca</th>
                    <th>Detalle</th>
                    <th>Movimientos</th>
                </tr>
                </thead>
                {products.map((product, index) => (
                    <tr key={product.id}>
                    <td>{product.id}</td>
                    <td>{product.name}</td>
                    <td>{product.brand}</td>
                    <td><button className="details-btn">Ver detalle</button></td>
                    <td><button className="movements-btn" onClick={handleClic()}>Ver movimientos</button></td>
                    </tr>
                ))}
            </table>
            </div>
        )
}
export default TableProducts;
